import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from 'react-router-dom';
import Stack from '@mui/material/Stack';

import Card from '../components/card';
import FormGroup from '../components/form-group';

import { mensagemSucesso, mensagemErro } from '../components/toastr';

import axios from 'axios';
import { BASE_URL } from '../config/axios';

function CadastroPedido() {
  const { idParam } = useParams();

  const navigate = useNavigate();

  const baseURL = `${BASE_URL}/pedidos`;

  const [id, setId] = useState('');
  const [cliente, setCliente] = useState('');
  const [produtos, setProdutos] = useState('');
  const [status, setStatus] = useState('');

  const [dados, setDados] = React.useState([]);


 function inicializar() {
    if (idParam == null) {
      setId('');
      setCliente('');
      setProdutos('');
      setStatus('');
    } else {
      setId(dados.id);
      setCliente(dados.cliente);
      setProdutos(dados.produtos);
      setStatus(dados.status);
    }
  }

    async function salvar() {
    let data = { id, nome, cpf, email, celular };
    data = JSON.stringify(data);
    if (idParam == null) {
      await axios
        .post(baseURL, data, {
          headers: { 'Content-Type': 'application/json' },
        })
        .then(function (response) {
          mensagemSucesso(`Professor ${nome} cadastrado com sucesso!`);
          navigate(`/listagem-professores`);
        })
        .catch(function (error) {
          mensagemErro(error.response.data);
        });
    } else {
      await axios
        .put(`${baseURL}/${idParam}`, data, {
          headers: { 'Content-Type': 'application/json' },
        })
        .then(function (response) {
          mensagemSucesso(`Professor ${nome} alterado com sucesso!`);
          navigate(`/listagem-professores`);
        })
        .catch(function (error) {
          mensagemErro(error.response.data);
        });
    }
  }
  async function buscar() {
    await axios.get(`${baseURL}/${idParam}`).then((response) => {
      setDados(response.data);
    });
    setId(dados.id);
    setCliente(dados.cliente);
    setProdutos(dados.produtos);
    setStatus(dados.status);
  }

  useEffect(() => {
    buscar(); // eslint-disable-next-line
  }, [id]);

  if (!dados) return null;

  return (
    <div className='container'>
      <Card title='Cadastro de Pedido'>
        <div className='row'>
          <div className='col-lg-12'>
            <div className='bs-component'>
              <FormGroup label='ID:' htmlFor='inputId'>
                <input
                  type='text'
                  id='inputId'
                  value={id}
                  className='form-control'
                  name='id'
                  onChange={(e) => setId(e.target.value)}
                />
              </FormGroup>

              <FormGroup label='Cliente:' htmlFor='inputCliente'>
                <input
                  type='text'
                  id='inputCliente'
                  value={cliente}
                  className='form-control'
                  name='cliente'
                  onChange={(e) => setCliente(e.target.value)}
                />
              </FormGroup>

              <FormGroup label='Produtos:' htmlFor='inputProdutos'>
                <input
                  type='text'
                  id='inputProdutos'
                  value={produtos}
                  className='form-control'
                  name='produtos'
                  onChange={(e) => setProdutos(e.target.value)}
                />
              </FormGroup>

              <FormGroup label='Status:' htmlFor={`inputStatus-${status}`}>
                <select
                  id={`inputStatus-${status}`}
                  className='form-control'
                  value={status}
                  disabled
                >
                  <option value='Pendente'>Pendente</option>
                  <option value='Em andamento'>Em andamento</option>
                  <option value='Concluído'>Concluído</option>
                </select>
              </FormGroup>

              <Stack spacing={1} padding={1} direction='row'>
                <button
                  onClick={salvar}
                  type='button'
                  className='btn btn-success'
                >
                  Salvar
                </button>
                <button
                  onClick={limparFormulario}
                  type='button'
                  className='btn btn-danger'
                >
                  Cancelar
                </button>
              </Stack>
            </div>
          </div>
        </div>
      </Card>
    </div>
  );
}

export default CadastroPedido;
